function App() {
  const token =
    "BQBW9KP7MVX4bYFCkletbcDb1fnJDgPTB-0_9Oo_T-9owTvx1lYCXppI5GThowirUHeSIsjd8cXW5JYMA_Jv2nmK0oqXB-oNGhg9sAY3oaE3rh6QBfi_WpPM4F-jvS1cN6TOhuMzG9gTzcQRQAGK0zkqFi8FE3hMVhU";
  const search = "kendrick";
  fetch(
    `https://api.spotify.com/v1/search?q=${search}&type=album,track,artist`,
    {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    }
  )
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      const artists = data.artists.items;
      const albums = data.albums.items;
      const tracks = data.tracks.items;
      console.log(artists[0]);
      document.getElementById("artists").innerHTML = artists[0].name;
    });
  return (
    <div className="App">
      <div id="artists"></div>
    </div>
  );
}

export default App;
